import React from "react";
import PropTypes from "prop-types";

const foodILike = [
  {
    id: 1,
    name: "Kimchi",
    image: "data:image/jpeg;base64,",
    rating: 4.9
  },
  {
    id: 2,
    name: "Samgyeopsal",
    image: "data:image/jpeg;base64,",
    rating: 4.8
  },
  {
    id: 3,
    name: "bibimbap",
    image: "data:image/jpeg;base64,",
    rating: 4.5
  },
  {
    id: 4,
    name: "tonkatsu",
    image: "data:image/jpeg;base64,",
    rating: 4.2
  },
  {
    id: 5,
    name: "susi",
    image: "data:image/jpeg;base64,",
    rating: 4.0
  },
  {
    id: 6,
    name: "teokgalbi",
    image: "data:image/jpeg;base64,",
    rating: 4.3
  },
];


function Food({ name, picture, rating }) {
  return (
    <div>
      <h2>I like{name}</h2>
      <img src={picture} alt={name} />
      <h4>Rating : {rating}</h4>
    </div>
  );
}

//propTypes 
Food.propTypes = {
  name : PropTypes.string.isRequired,
  picture:PropTypes.string.isRequired,
  rating:PropTypes.number,
};

function App() {
  return (
    <div>
      {foodILike.map(dish => (
        <Food
          key={dish.id}
          name={dish.name}
          picture={dish.image}
          rating={dish.rating} />
      ))}
    </div>
  );
}

export default App;